import React, { Component } from 'react'
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Container
} from 'reactstrap'

class AppNavbar extends Component {
    state = {
        isOpen: false
    }
    toggle = () => {
        this.setState( {
            isOpen: !this.state.isOpen
        } );
    }
    render() {
        return (
            <div>
                <Navbar color="dark" dark expand="sm" className="mb-5" >
                    <Container>
                        <NavbarBrand href="/">Books List</NavbarBrand>
                        <NavbarToggler onClick={this.state.toggle} />
                        <Collapse isOpen={this.state.isOpen} navbar>
                            <Nav className="ml-auto" navbar>
                                <NavItem>
                                    <NavLink className="links" href="/">Search
                                </NavLink>
                                    <NavLink className="links" href="/books">Saved
                                </NavLink>
                                </NavItem>
                            </Nav>
                        </Collapse>
                    </Container>
                </Navbar>
            </div>
        )
    }
}

export default AppNavbar;
